import React from 'react';
import ResultList from './ResultList';
import ResultHeader from './ResultHeader';

const resultView = ({ location, isCustom, data, randomSorting }) => {
  return (
    <div>
      <ResultHeader location={location} isCustom={isCustom} />
      <ResultList data={data} isCustom={isCustom} randomSorting={randomSorting} />
    </div>
  );
};

export default resultView;
